import{_ as t,c as i,o as s,ag as a}from"./chunks/framework.CQuhCYrb.js";const u=JSON.parse('{"title":"Troubleshooting","description":"","frontmatter":{},"headers":[],"relativePath":"guide/troubleshooting.md","filePath":"guide/troubleshooting.md"}'),o={name:"guide/troubleshooting.md"};function n(r,e,l,d,c,h){return s(),i("div",null,[...e[0]||(e[0]=[a(`<h1 id="troubleshooting" tabindex="-1">Troubleshooting <a class="header-anchor" href="#troubleshooting" aria-label="Permalink to &quot;Troubleshooting&quot;">​</a></h1><p>Common issues and how to fix them. Can&#39;t find your issue? <a href="https://github.com/sciorex/sciorex/issues" target="_blank" rel="noreferrer">Open a GitHub issue</a>.</p><div class="tip custom-block"><p class="custom-block-title">Quick Fixes</p><p>Most issues can be resolved by:</p><ol><li>Restarting the application</li><li>Re-authenticating Claude CLI (<code>claude login</code>)</li><li>Checking your internet connection</li></ol></div><h2 id="installation-issues" tabindex="-1">Installation Issues <a class="header-anchor" href="#installation-issues" aria-label="Permalink to &quot;Installation Issues&quot;">​</a></h2><h3 id="claude-cli-not-found" tabindex="-1">Claude CLI not found <a class="header-anchor" href="#claude-cli-not-found" aria-label="Permalink to &quot;Claude CLI not found&quot;">​</a></h3><p><strong>Symptom:</strong> Sciorex shows &quot;Claude Code CLI not found&quot; or AI features don&#39;t work.</p><p><strong>Solution:</strong></p><ol><li><p>Install Claude Code CLI:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">npm</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -g</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> @anthropic-ai/claude-code</span></span></code></pre></div></li><li><p>Verify it&#39;s installed:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">claude</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> --version</span></span></code></pre></div></li><li><p>If still not found, check your PATH. The CLI needs to be accessible from your terminal.</p></li></ol><h3 id="permission-errors-on-linux-appimage" tabindex="-1">Permission errors on Linux (AppImage) <a class="header-anchor" href="#permission-errors-on-linux-appimage" aria-label="Permalink to &quot;Permission errors on Linux (AppImage)&quot;">​</a></h3><p><strong>Symptom:</strong> Cannot run the AppImage file.</p><p><strong>Solution:</strong></p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">chmod</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> +x</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> Sciorex-</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;">*</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">.AppImage</span></span></code></pre></div><h3 id="macos-security-warning" tabindex="-1">macOS security warning <a class="header-anchor" href="#macos-security-warning" aria-label="Permalink to &quot;macOS security warning&quot;">​</a></h3><p><strong>Symptom:</strong> macOS says the app is from an unidentified developer.</p><p><strong>Solution:</strong></p><ol><li>Open <strong>System Preferences</strong> → <strong>Security &amp; Privacy</strong></li><li>Click <strong>Open Anyway</strong> next to the blocked app message</li></ol><h3 id="windows-defender-blocking" tabindex="-1">Windows Defender blocking <a class="header-anchor" href="#windows-defender-blocking" aria-label="Permalink to &quot;Windows Defender blocking&quot;">​</a></h3><p><strong>Symptom:</strong> Windows SmartScreen blocks the installer.</p><p><strong>Solution:</strong></p><ol><li>Click <strong>More info</strong></li><li>Click <strong>Run anyway</strong></li></ol><h2 id="chat-and-agent-issues" tabindex="-1">Chat and Agent Issues <a class="header-anchor" href="#chat-and-agent-issues" aria-label="Permalink to &quot;Chat and Agent Issues&quot;">​</a></h2><h3 id="chat-won-t-start" tabindex="-1">Chat won&#39;t start <a class="header-anchor" href="#chat-won-t-start" aria-label="Permalink to &quot;Chat won&#39;t start&quot;">​</a></h3><p><strong>Possible causes:</strong></p><ul><li>Claude CLI not installed or not in PATH</li><li>No internet connection</li><li>API authentication expired</li></ul><p><strong>Solutions:</strong></p><ol><li>Check Claude CLI is working: <code>claude --version</code></li><li>Re-authenticate: <code>claude login</code></li><li>Check your network connection</li></ol><h3 id="messages-not-appearing" tabindex="-1">Messages not appearing <a class="header-anchor" href="#messages-not-appearing" aria-label="Permalink to &quot;Messages not appearing&quot;">​</a></h3><p><strong>Symptom:</strong> You send a message but nothing shows up.</p><p><strong>Check:</strong></p><ul><li>Session status (should be &quot;running&quot;)</li><li>Scroll to bottom of conversation</li><li>Check for error indicators</li></ul><h3 id="permission-modal-stuck" tabindex="-1">Permission modal stuck <a class="header-anchor" href="#permission-modal-stuck" aria-label="Permalink to &quot;Permission modal stuck&quot;">​</a></h3><p><strong>Symptom:</strong> Permission request appears but buttons don&#39;t work.</p><p><strong>Solutions:</strong></p><ol><li>Click the buttons again</li><li>Press Escape to close and retry</li><li>Restart the application</li></ol><h3 id="agent-runs-indefinitely" tabindex="-1">Agent runs indefinitely <a class="header-anchor" href="#agent-runs-indefinitely" aria-label="Permalink to &quot;Agent runs indefinitely&quot;">​</a></h3><p><strong>Symptom:</strong> Agent keeps running without producing output.</p><p><strong>Solutions:</strong></p><ol><li>Check the status indicator</li><li>Cancel the session if needed</li><li>Some complex tasks legitimately take time, especially with extended thinking enabled</li></ol><h2 id="ticket-issues" tabindex="-1">Ticket Issues <a class="header-anchor" href="#ticket-issues" aria-label="Permalink to &quot;Ticket Issues&quot;">​</a></h2><h3 id="tickets-not-loading" tabindex="-1">Tickets not loading <a class="header-anchor" href="#tickets-not-loading" aria-label="Permalink to &quot;Tickets not loading&quot;">​</a></h3><p><strong>Check:</strong></p><ul><li>The <code>.sciorex/tickets/</code> directory exists</li><li>YAML files are valid (no syntax errors)</li><li>File permissions allow reading</li></ul><p><strong>Fix invalid YAML:</strong> Open the ticket file and check for:</p><ul><li>Missing colons after field names</li><li>Incorrect indentation</li><li>Unclosed quotes</li></ul><h3 id="drag-and-drop-not-working" tabindex="-1">Drag and drop not working <a class="header-anchor" href="#drag-and-drop-not-working" aria-label="Permalink to &quot;Drag and drop not working&quot;">​</a></h3><p><strong>Possible causes:</strong></p><ul><li>Invalid status transition (not all moves are allowed)</li><li>Ticket has blockers</li><li>File permission issues</li></ul><p><strong>Check the status transition rules:</strong></p><table tabindex="0"><thead><tr><th>From</th><th>Can move to</th></tr></thead><tbody><tr><td>Backlog</td><td>Planned, Cancelled</td></tr><tr><td>Planned</td><td>Backlog, In Progress, Cancelled</td></tr><tr><td>In Progress</td><td>Planned, In Review, Done, Cancelled</td></tr><tr><td>In Review</td><td>In Progress, Done, Cancelled</td></tr><tr><td>Done</td><td>In Progress</td></tr></tbody></table><h3 id="changes-not-saving" tabindex="-1">Changes not saving <a class="header-anchor" href="#changes-not-saving" aria-label="Permalink to &quot;Changes not saving&quot;">​</a></h3><p><strong>Check:</strong></p><ul><li>Write permissions on <code>.sciorex/</code> directory</li><li>Disk space available</li><li>No file locks from other programs</li></ul><h2 id="flow-issues" tabindex="-1">Flow Issues <a class="header-anchor" href="#flow-issues" aria-label="Permalink to &quot;Flow Issues&quot;">​</a></h2><h3 id="flow-won-t-run" tabindex="-1">Flow won&#39;t run <a class="header-anchor" href="#flow-won-t-run" aria-label="Permalink to &quot;Flow won&#39;t run&quot;">​</a></h3><p><strong>Check:</strong></p><ul><li>Flow has at least one trigger node</li><li>All nodes are connected</li><li>Agent references exist</li><li>No validation errors (check for warnings)</li></ul><h3 id="flow-stuck-on-a-node" tabindex="-1">Flow stuck on a node <a class="header-anchor" href="#flow-stuck-on-a-node" aria-label="Permalink to &quot;Flow stuck on a node&quot;">​</a></h3><p><strong>Possible causes:</strong></p><ul><li>Agent taking a long time</li><li>Wait node expecting input</li><li>Error in previous node</li></ul><p><strong>Solutions:</strong></p><ol><li>Check the node status</li><li>Provide input if it&#39;s a Wait node</li><li>Cancel and check logs for errors</li></ol><h3 id="data-not-passing-between-nodes" tabindex="-1">Data not passing between nodes <a class="header-anchor" href="#data-not-passing-between-nodes" aria-label="Permalink to &quot;Data not passing between nodes&quot;">​</a></h3><p><strong>Check your template syntax:</strong></p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>Correct:   {{previousNode.output}}</span></span>
<span class="line"><span>Correct:   {{nodes.myAgent.output.summary}}</span></span>
<span class="line"><span>Wrong:     {previousNode.output}</span></span>
<span class="line"><span>Wrong:     {{previousNode}}</span></span></code></pre></div><h2 id="performance-issues" tabindex="-1">Performance Issues <a class="header-anchor" href="#performance-issues" aria-label="Permalink to &quot;Performance Issues&quot;">​</a></h2><h3 id="application-running-slowly" tabindex="-1">Application running slowly <a class="header-anchor" href="#application-running-slowly" aria-label="Permalink to &quot;Application running slowly&quot;">​</a></h3><p><strong>Try:</strong></p><ol><li>Close unused sessions</li><li>Reduce the number of background tasks</li><li>Restart the application</li><li>Check system resources (RAM, CPU)</li></ol><h3 id="large-conversations-lagging" tabindex="-1">Large conversations lagging <a class="header-anchor" href="#large-conversations-lagging" aria-label="Permalink to &quot;Large conversations lagging&quot;">​</a></h3><p>Very long conversations can slow down the UI. Consider:</p><ul><li>Starting a new session</li><li>Branching to continue with less context</li><li>Archiving old sessions</li></ul><h2 id="data-and-storage" tabindex="-1">Data and Storage <a class="header-anchor" href="#data-and-storage" aria-label="Permalink to &quot;Data and Storage&quot;">​</a></h2><h3 id="where-is-my-data-stored" tabindex="-1">Where is my data stored? <a class="header-anchor" href="#where-is-my-data-stored" aria-label="Permalink to &quot;Where is my data stored?&quot;">​</a></h3><p>All data is in your workspace&#39;s <code>.sciorex/</code> directory:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>.sciorex/</span></span>
<span class="line"><span>├── agents/      # Agent definitions</span></span>
<span class="line"><span>├── flows/       # Flow definitions</span></span>
<span class="line"><span>├── tickets/     # Ticket files</span></span>
<span class="line"><span>├── epics/       # Epic files</span></span>
<span class="line"><span>├── sessions/    # Chat and agent sessions</span></span>
<span class="line"><span>└── config/      # Settings</span></span></code></pre></div><h3 id="how-to-back-up" tabindex="-1">How to back up <a class="header-anchor" href="#how-to-back-up" aria-label="Permalink to &quot;How to back up&quot;">​</a></h3><p>Since everything is in <code>.sciorex/</code>, you can:</p><ul><li>Commit it to Git (recommended)</li><li>Copy the directory manually</li><li>Use your normal backup tools</li></ul><h3 id="recovering-deleted-data" tabindex="-1">Recovering deleted data <a class="header-anchor" href="#recovering-deleted-data" aria-label="Permalink to &quot;Recovering deleted data&quot;">​</a></h3><p>If you committed <code>.sciorex/</code> to Git, use <code>git checkout</code> to restore files.</p><p>Otherwise, check your system&#39;s trash/recycle bin, the files might still be there.</p><h2 id="mcp-server-issues" tabindex="-1">MCP Server Issues <a class="header-anchor" href="#mcp-server-issues" aria-label="Permalink to &quot;MCP Server Issues&quot;">​</a></h2><h3 id="mcp-tools-not-appearing" tabindex="-1">MCP tools not appearing <a class="header-anchor" href="#mcp-tools-not-appearing" aria-label="Permalink to &quot;MCP tools not appearing&quot;">​</a></h3><p><strong>Symptom:</strong> Custom MCP tools don&#39;t show up in the tool permissions.</p><p><strong>Solutions:</strong></p><ol><li>Check that Claude CLI has the MCP server configured: <code>claude mcp list</code></li><li>Verify the server is running and accessible</li><li>Check the MCP server logs for errors</li><li>Restart the chat session</li></ol><h3 id="mcp-server-crashes" tabindex="-1">MCP server crashes <a class="header-anchor" href="#mcp-server-crashes" aria-label="Permalink to &quot;MCP server crashes&quot;">​</a></h3><p><strong>Symptom:</strong> Session fails with MCP-related errors.</p><p><strong>Check:</strong></p><ul><li>Server dependencies are installed</li><li>Server script has execute permissions</li><li>No port conflicts with other services</li><li>Server configuration is valid JSON/YAML</li></ul><h3 id="sciorex-mcp-servers-not-working" tabindex="-1">Sciorex MCP servers not working <a class="header-anchor" href="#sciorex-mcp-servers-not-working" aria-label="Permalink to &quot;Sciorex MCP servers not working&quot;">​</a></h3><p>The built-in Sciorex MCP servers (<code>sciorex-tickets</code>, <code>sciorex-interactions</code>, <code>sciorex-resources</code>) require:</p><ul><li>A valid workspace to be open</li><li>The <code>.sciorex/</code> directory to exist</li><li>Proper file permissions</li></ul><p><strong>Reset MCP servers:</strong></p><ol><li>Go to Settings → MCP</li><li>Click &quot;Reconnect All&quot;</li><li>If that fails, restart the application</li></ol><h2 id="git-worktree-issues" tabindex="-1">Git Worktree Issues <a class="header-anchor" href="#git-worktree-issues" aria-label="Permalink to &quot;Git Worktree Issues&quot;">​</a></h2><h3 id="worktree-creation-fails" tabindex="-1">Worktree creation fails <a class="header-anchor" href="#worktree-creation-fails" aria-label="Permalink to &quot;Worktree creation fails&quot;">​</a></h3><p><strong>Symptom:</strong> Cannot create a new worktree for a session.</p><p><strong>Check:</strong></p><ul><li>You have a Git repository initialized</li><li>The target directory doesn&#39;t already exist</li><li>You have write permissions to the parent directory</li></ul><p><strong>Manual fix:</strong></p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;"># Remove orphan worktree references</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> worktree</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> prune</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;"># List current worktrees</span></span>
<span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">git</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> worktree</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> list</span></span></code></pre></div><h3 id="worktree-changes-not-syncing" tabindex="-1">Worktree changes not syncing <a class="header-anchor" href="#worktree-changes-not-syncing" aria-label="Permalink to &quot;Worktree changes not syncing&quot;">​</a></h3><p><strong>Remember:</strong> Worktrees are independent working directories. Changes in one don&#39;t automatically appear in others.</p><p><strong>To sync:</strong></p><ol><li>Commit changes in the source worktree</li><li>In the target worktree: <code>git fetch &amp;&amp; git merge origin/branch</code></li></ol><p>Or use the built-in sync button in the session panel.</p><h2 id="api-and-authentication" tabindex="-1">API and Authentication <a class="header-anchor" href="#api-and-authentication" aria-label="Permalink to &quot;API and Authentication&quot;">​</a></h2><h3 id="authentication-expired-error" tabindex="-1">&quot;Authentication expired&quot; error <a class="header-anchor" href="#authentication-expired-error" aria-label="Permalink to &quot;&quot;Authentication expired&quot; error&quot;">​</a></h3><p><strong>Solution:</strong></p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">claude</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> login</span></span></code></pre></div><p>Then restart the Sciorex session.</p><h3 id="rate-limiting-errors" tabindex="-1">Rate limiting errors <a class="header-anchor" href="#rate-limiting-errors" aria-label="Permalink to &quot;Rate limiting errors&quot;">​</a></h3><p><strong>Symptom:</strong> Messages fail with rate limit errors.</p><p><strong>Solutions:</strong></p><ol><li>Wait a few minutes before retrying</li><li>Reduce the frequency of requests</li><li>Check your Anthropic API usage dashboard</li><li>Consider upgrading your API plan</li></ol><h3 id="extended-thinking-not-working" tabindex="-1">Extended thinking not working <a class="header-anchor" href="#extended-thinking-not-working" aria-label="Permalink to &quot;Extended thinking not working&quot;">​</a></h3><p><strong>Check:</strong></p><ul><li>Model supports extended thinking (Opus, Sonnet)</li><li>Agent has thinking level set (<code>thinkingLevel: think</code>)</li><li>You have sufficient API credits for extended thinking</li></ul><h2 id="error-codes" tabindex="-1">Error Codes <a class="header-anchor" href="#error-codes" aria-label="Permalink to &quot;Error Codes&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Error</th><th>Meaning</th><th>Solution</th></tr></thead><tbody><tr><td><code>ECLI_NOT_FOUND</code></td><td>Claude CLI not installed</td><td>Install Claude CLI</td></tr><tr><td><code>EAUTH_EXPIRED</code></td><td>Authentication expired</td><td>Run <code>claude login</code></td></tr><tr><td><code>ERATE_LIMIT</code></td><td>Too many requests</td><td>Wait and retry</td></tr><tr><td><code>EMCP_CONNECT</code></td><td>MCP server connection failed</td><td>Check server status</td></tr><tr><td><code>EWORKSPACE</code></td><td>Workspace not found</td><td>Open a valid directory</td></tr><tr><td><code>EPERMISSION</code></td><td>Insufficient permissions</td><td>Check file/tool permissions</td></tr></tbody></table><h2 id="debug-mode" tabindex="-1">Debug Mode <a class="header-anchor" href="#debug-mode" aria-label="Permalink to &quot;Debug Mode&quot;">​</a></h2><p>For advanced troubleshooting, enable debug mode:</p><ol><li>Go to <strong>Settings</strong> → <strong>Advanced</strong></li><li>Enable <strong>Debug Mode</strong></li><li>Restart the application</li><li>Check the developer console (<code>Ctrl/Cmd + Shift + I</code>) for detailed logs</li></ol><h2 id="log-files" tabindex="-1">Log Files <a class="header-anchor" href="#log-files" aria-label="Permalink to &quot;Log Files&quot;">​</a></h2><p>Log files are stored at:</p><table tabindex="0"><thead><tr><th>Platform</th><th>Location</th></tr></thead><tbody><tr><td>Windows</td><td><code>%APPDATA%\\Sciorex\\logs\\</code></td></tr><tr><td>macOS</td><td><code>~/Library/Logs/Sciorex/</code></td></tr><tr><td>Linux</td><td><code>~/.config/Sciorex/logs/</code></td></tr></tbody></table><p>Include relevant log excerpts when filing bug reports.</p><h2 id="reset-options" tabindex="-1">Reset Options <a class="header-anchor" href="#reset-options" aria-label="Permalink to &quot;Reset Options&quot;">​</a></h2><h3 id="soft-reset" tabindex="-1">Soft Reset <a class="header-anchor" href="#soft-reset" aria-label="Permalink to &quot;Soft Reset&quot;">​</a></h3><p>Clear the current session without losing data:</p><ul><li>Close all sessions</li><li>Restart the application</li></ul><h3 id="reset-workspace-settings" tabindex="-1">Reset Workspace Settings <a class="header-anchor" href="#reset-workspace-settings" aria-label="Permalink to &quot;Reset Workspace Settings&quot;">​</a></h3><p>Delete <code>.sciorex/config/</code> to reset workspace-specific settings.</p><h3 id="full-reset" tabindex="-1">Full Reset <a class="header-anchor" href="#full-reset" aria-label="Permalink to &quot;Full Reset&quot;">​</a></h3><div class="danger custom-block"><p class="custom-block-title">DANGER</p><p>This will delete all Sciorex data for the workspace.</p></div><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">rm</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> -rf</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> .sciorex/</span></span></code></pre></div><h2 id="getting-more-help" tabindex="-1">Getting More Help <a class="header-anchor" href="#getting-more-help" aria-label="Permalink to &quot;Getting More Help&quot;">​</a></h2><p>If you&#39;re still stuck:</p><ol><li><strong>Search existing issues</strong>: <a href="https://github.com/sciorex/sciorex/issues" target="_blank" rel="noreferrer">GitHub Issues</a></li><li><strong>Join the community</strong>: <a href="https://discord.gg/sciorex" target="_blank" rel="noreferrer">Discord</a></li><li><strong>File a new issue</strong> with: <ul><li>Steps to reproduce</li><li>Expected vs actual behavior</li><li>OS and Sciorex version (<code>Help → About</code>)</li><li>Relevant log excerpts</li><li>Screenshots if applicable</li></ul></li></ol><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Include your Sciorex version number when asking for help. Find it in <strong>Help → About</strong> or the settings panel.</p></div>`,141)])])}const g=t(o,[["render",n]]);export{u as __pageData,g as default};
